function Home(){
    return(
        <div className="home">
            <h1 className="home-title">Recipe Finder</h1>
            <p className="home-p">--------------- <em>All You Can Find Recipes</em> ---------------</p>
            <h5 className="home-h5">Search for a beloved recipe to cook or add your very own recipe to the collection for others to enjoy!</h5>
            <p className="p-left">This website sole purpose is to give people in the kitchen the confidence to be able to cook anything that they may desire</p>
            <p className="p-right">Be sure to searc through everything and enjoy your visit here at Recipe Finder</p>
        </div>
    )
}

export default Home;
